import './App.css';
import LandingPage from './components/landingpage';
import ContactPage from './components/contactpage';
import APropos from './components/apropos';
import ChroniquePage from './components/chronique';
import ClosingDecouvre from './components/closingjedecouvre';
import ClosingAcademie from './components/closingacademie';
import OneArticleAcademie from './components/displayOneArticleAcademie';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';
import { useParams } from 'react-router-dom'

function App() {
  return (
    <div>
      <Router>
        <Routes>
          <Route path="/home" component={<LandingPage />}></Route>
          <Route path="/contact" component={<ContactPage />}></Route>
          <Route path="/apropos" component={<APropos />}></Route>
          <Route path="/chronique" component={<ChroniquePage />}></Route>
          <Route path="/jedecouvre" component={<ClosingDecouvre />}></Route>
          <Route path="/academie" component={<ClosingAcademie />}></Route>
          <Route path="/academie/:id" component={<OneArticleAcademie />}></Route>           
        </Routes>
      </Router>
    </div>
  );
}

export default App;
